parseGame :: Parser Game
parseGame = do
              many' space
              id <- decimal
              many1' space
              exampleGame <- option False (string "(Exam." *> pure True)
              many' space
              p1Rating <- parseRating
              space
              p1Name <- manyTill anyChar space
              many1' space
              p2Rating <- parseRating
              space
              p2Name <- manyTill anyChar space
              many1' space
              option "" (string ")")
              many' space
              char '['
              isPrivate <- parseIsPrivate
              gameType <- parseGameType
              isRated <- parseIsRated
              return $ Game id exampleGame p1Rating p1Name p2Rating p2Name $
                       GameSettings isPrivate gameType isRated


parseRating :: Parser Rating
parseRating = (decimal >>= \r -> return $ Rating r) <|>
               string "++++" *> pure Guest <|>
               string "----" *> pure Unrated


parseGameType :: Parser GameType
parseGameType = char 'b' *> pure Blitz <|>
                char 'l' *> pure Lightning <|>
                char 'u' *> pure Untimed <|>
                char 'e' *> pure ExaminedGame <|>
                char 's' *> pure Standard <|>
                char 'w' *> pure Wild <|>
                char 'x' *> pure Atomic <|>
                char 'z' *> pure Crazyhouse <|>
                char 'B' *> pure Bughouse <|>
                char 'L' *> pure Losers <|>
                char 'S' *> pure Suicide <|>
                char 'n' *> pure NonStandardGame


parseIsPrivate :: Parser Bool
parseIsPrivate = space *> pure False <|> char 'p' *> pure True


parseIsRated :: Parser Bool
parseIsRated = char 'u' *> pure False <|> char 'r' *> pure True

